/* eslint-disable react/jsx-pascal-case */
/* eslint-disable jsx-a11y/anchor-is-valid */
import React from "react";

import Brand from "./brand";
import Currency from "./currency";
import Products from "./currentproduct";
import News from "./news";
import Saleproduct from "./saleproduct";
import Slider_home from "./slider";
import Coming from "./upcoming";

const Home = () => {
  return (
    <main className="">
      <div className="container">
        <div className="row mt-3">
          <div className="w-100 slide-contain custom-slick">
            <Slider_home />
          </div>

          <hr className="mt-3" />
        </div>

        <div className="mt-3 product-slide custom-slick">
          <h2 className="fw-bold">Sản phẩm giảm giá</h2>
          <Saleproduct />
          <a
            href={"#"}
            className=" border rounded-pill mt-4 view-all d-block m-auto "
          >
            {" "}
            <b>Xem tất cả </b>{" "}
          </a>
        </div>

        <div className="mt-5">
          <h2 className="fw-bold">Laptop hiện có</h2>
          <Brand />
          <div className="mt-3">
            <h6 className=" fw-bold">Khoảng giá </h6>
            <Currency />
          </div>
          <Products />
          <a
            href={"#"}
            className=" border rounded-pill mt-4 view-all d-block m-auto "
          >
            {" "}
            <b>Xem tất cả </b>{" "}
          </a>
        </div>

        <div className="mt-3 product-slide custom-slick">
          <h2 className="fw-bold">Hàng đang về</h2>
          <Coming />

          <a
            href={"#"}
            className=" border rounded-pill mt-4 view-all d-block m-auto "
          >
            {" "}
            <b>Xem tất cả </b>{" "}
          </a>
        </div>
      </div>
    </main>
  );
};

export default Home;
